import React,{useEffect, Fragment} from 'react'
import{ connect }  from "react-redux";
import { getCurrentUserProfile } from '../../actions/profile';
import DashboardAction from './DashboardAction';
import ListExperience from './ListExperience';
import Spinner from "../layout/Spinner";
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';

export const Dashboard = ({getCurrentUserProfile, auth, profile}) => {
    console.log("Profile....", profile, "Profile.profile", profile.profile,"profils", profile.profiles)
    useEffect(() => {
        getCurrentUserProfile();
    }, []);
    
    return profile.loading ? <Spinner></Spinner> : 
    <Fragment>
        <h1 className="large text-primary">Dashboard</h1>
<p className="lead"><i className="fa fa-user"></i>Welcome {auth.user.name}</p>
    
    { profile.profile != null ?(
        <Fragment>
            <DashboardAction></DashboardAction>
            <ListExperience></ListExperience>
        </Fragment>
    ):(
        <Fragment
            ><p>Have not setup profile . please setup profile</p>
            <Link to="/create-profile" className="btn btn-primary my-1">Create Profile</Link>
        </Fragment>
    )}
   
    </Fragment>
    // (
    //     <div>
    //         <h1>Dashboard</h1>
    //     </div>
    // )
}

Dashboard.prototype = {
    auth: PropTypes.object.isRequired,
    profile : PropTypes.object.isRequired,
    getCurrentUserProfile : PropTypes.func.isRequired,
  }

const mapStateToProps=state=>({
    auth : state.auth,
    profile : state.profile,
  })
  
export default connect(mapStateToProps, { getCurrentUserProfile  })(Dashboard);
